INSERT INTO `method` VALUES ('3', '0', 'apijson/demo/server', 'DemoFunction', '[\n        {},  //RequestMethod method\n        {},  //String tag\n        {\n            \"value\": 0  //int version\n        },\n        {}  //HttpSession session\n    ]', 'countArray', '[\n        {\n            \"value\": {\n                \"arr\": [\n                    1,\n                    2,\n                    3\n                ]\n            }\n        },\n        {\n            \"value\": \"arr\"\n        }\n    ]', null, 'Integer', '0', null, '{\"array\": [1, 2, 3]}', '获取数组长度。没写调用键值对，会自动补全 \"result()\": \"countArray(array)\"', '2018-10-13 16:23:23');
INSERT INTO `method` VALUES ('4', '0', 'apijson/demo/server', 'DemoFunction', '[\n        {},  //RequestMethod method\n        {},  //String tag\n        {\n            \"value\": 0  //int version\n        },\n        {}  //HttpSession session\n    ]', 'countObject', '[\n        {   //JSONObject request\n            \"value\": {\n                \"1\": 1,\n                \"2\": 2\n            }\n        },\n        {   //String num0\n            \"value\": \"1\"\n        },\n        {   //String num1\n            \"type\": \"String\",\n            \"value\": \"2\"\n        }\n    ]', null, 'Integer', '0', null, '{\"object\": {\"key0\": 1, \"key1\": 2}}', '获取对象长度。', '2018-10-13 16:23:23');
